import React, { useState } from 'react';
import Dashboard from './components/Dashboard';
import Filters from './components/Filters';
import NetMovementModal from './components/NetMovementModal';

function App() {
  const [filters, setFilters] = useState({ date: '', base: '', equipment: '' });
  const [modalOpen, setModalOpen] = useState(false);

  const handleFilterChange = (updatedFilters) => setFilters(updatedFilters);

  return (
    <div className="App">
      <h1 className="title">Asset Management Dashboard</h1>
      <Filters onFilterChange={handleFilterChange} />
      <Dashboard filters={filters} onNetMovementClick={() => setModalOpen(true)} />
      {modalOpen && <NetMovementModal onClose={() => setModalOpen(false)} />}
    </div>
  );
}

export default App;
